var logLevel="info";function dummy(){}function shouldLog(b){var a=(logLevel==="info"&&b==="info")||(["info","warning"].indexOf(logLevel)>=0&&b==="warning")||(["info","warning","error"].indexOf(logLevel)>=0&&b==="error");return a}function logGroup(a){return function(c,b){if(shouldLog(c)){a(b)}}}module.exports=function(b,a){if(shouldLog(b)){if(b==="info"){console.log(a)}else{if(b==="warning"){console.warn(a)}else{if(b==="error"){console.error(a)}}}}};var group=console.group||dummy;var groupCollapsed=console.groupCollapsed||dummy;var groupEnd=console.groupEnd||dummy;module.exports.group=logGroup(group);module.exports.groupCollapsed=logGroup(groupCollapsed);module.exports.groupEnd=logGroup(groupEnd);module.exports.setLogLevel=function(a){logLevel=a};